#include <stdio.h>

int main() {
    int i, count;

    printf("请输入攻击次数：");
    scanf("%d", &count);

    if (count <= 0) {
        printf("攻击次数必须是正整数！\n");
        return 1;
    }

    for (i = 1; i <= count; i++) {
        // 检查是否满足“踢足球”的条件，这里假设当i是5的倍数时踢足球
        if (i % 5 == 0) {
            printf("踢足球\n");
            break;
        }

        printf("哈气\n");

        // 检查是否满足“啊啊啊啊啊啊胖宝宝胖宝宝”的条件，这里假设当i是2的倍数时加强哈气
        if (i % 2 == 0) {
            printf("啊啊啊啊啊啊胖宝宝胖宝宝\n");
        }

        if (i % 3 == 0) {
            printf("挥手\n");
        }

        if (i == count) {
            printf("跳跃\n");
            break;
        }
    }

    return 0;
}
